(2, 1, 36, 2, 'Kris Kristofferson: Feeling Mortal -2 ', '<p><strong>First collection of new material in four years</strong><br />\r\nAvailable on iTunes January 22, 2013<br />\r\nIn Record Stores on January 29, 2013<br />\r\n<br />\r\nNashville, TN<br />\r\n<br />\r\nLegendary songwriter/singer/actor/activist Kris Kristofferson will release Feeling Mortal, his first collection of new material in four years on January 29, 2013.<br />\r\n<br />\r\nKristofferson is a Country Music Hall of Famer who ranks<a href="http://www.kriskristofferson.com/" target="_blank"><img alt="Kris Kristofferson - Feeling Mortal" src="http://www.rootsmusicreport.com/rmr_test/app/webroot/img/articles/press-release/kris-kristoferson-feeling-mortal.jpg" style="width: 250px; height: 222px; float: right;" /></a> among the most versatile of American talents. He&rsquo;s been a Golden Gloves boxer, a Rhodes scholar, a college football player, an acclaimed actor, a military officer, a helicopter pilot, a Grammy-winner, a screw-up and an icon, and now he finds himself releasing the third Don Was-produced album in a twilight years trilogy. Feeling Mortal follows 2009&rsquo;s Closer To The Bone and 2006&rsquo;s This Old Road in examining hard-won grace.<br />\r\n<br />\r\n&ldquo;Wide awake and feeling mortal,&rdquo; he writes on the title track. &ldquo;At this moment in the dream/ That old man there in the mirror/ And my shaky self-esteem.&rdquo;<br />\r\n<br />\r\n&ldquo;Going back to the beginning, the songs have been reflections of where I was at that point in my life,&rdquo; he says. &ldquo;I always try to be as honest as I can in the songwriting, otherwise there&rsquo;s no point in doing it: I might as well be doing an advertising job or something. And what I&rsquo;m finding, to my pleasant surprise at this age, is that I&rsquo;m more inclined to laughter than tears. I hope I&rsquo;ll feel this creative and this grateful until they throw dirt over me.&rdquo;<br />\r\n<br />\r\nThe now 76-year-old Kristofferson did not always imagine this would be so. &ldquo;If I look like a mean old man, that&rsquo;s what I am,&rdquo; he sang, back when he was still immortal and when he was sometimes a mean-feeling younger man. But now he&rsquo;s mostly truthful and thankful, as he sings, &ldquo;For the laughter and the loving/ That I&rsquo;m living with today.&rdquo;<br />\r\n<br />\r\nThat doesn&rsquo;t mean Feeling Mortal works as anyone&rsquo;s greeting card of soft-peddled feelings. &ldquo;Just Suppose&rdquo; is another look in the mirror, a negotiation with shame&rsquo;s reflection. &ldquo;Castaway&rdquo; is a cry of the heart, and a memory of a long-ago scene Kristofferson witnessed from the air, when he was flying helicopters over the Gulf of Mexico. And &ldquo;My Heart Was The Last One To Know&rdquo; is a harrowing old song, written by Kristofferson and genius poet/author/cartoonist/songwriter Shel Silverstein and previously recorded by Connie Smith.<br />\r\n<br />\r\n&ldquo;Shel was the only person I consistently wrote songs with,&rdquo; Kristofferson says. &ldquo;He was a fantastic writer. We did about a dozen songs, and usually he&rsquo;d write down some titles and a description of what he was thinking about, and I&rsquo;d go off and come back with a song.&rdquo;<br />\r\n<br />\r\nThe album ends with &ldquo;Ramblin&rsquo; Jack,&rdquo; a song ostensibly about Kristofferson&rsquo;s folk-singing friend Ramblin&rsquo; Jack Elliott. Kristofferson approached the song as something of a self-penned co-write, inspired and begun by his younger self and finished in the present and mortal day. The second verse is the new one: &ldquo;And if he knew how good he&rsquo;d done/ Every song he ever sung/ I believe he&rsquo;d truly be surprised.&rdquo;<br />\r\n<br />\r\n&ldquo;Ramblin&rsquo; Jack&rsquo;s one of those people whose whole life was music,&rdquo; Kristofferson says. &ldquo;He&rsquo;s like William Blake and Bob Dylan and other people who just believed and lived for whatever poetry they could come up with. That&rsquo;s probably the thing I was trying to be.&rdquo;</p>\r\n\r\n<p><a href="http://www.kriskristofferson.com/" target="_blank"><img alt="Kris Kristoferson" src="http://www.rootsmusicreport.com/rmr_test/app/webroot/img/articles/press-release/kris-kristoferson.jpg" style="width: 480px; height: 270px;" /></a><br />\r\n<br />\r\nThat&rsquo;s the thing he was, and the thing he is.<br />\r\n<br />\r\nIn the Nashville beginning, Kristofferson threw away a promising military career in favor of life as what he sometimes calls, &ldquo;A songwriting bum.&rdquo; He had excelled at most everything he&rsquo;d ever tried, save for singing and songwriting, but it was the singing and the writing that called to him. He wound up penning classics including &ldquo;Me and Bobby McGee,&rdquo; &ldquo;Help Me Make It Through the Night,&rdquo; &ldquo;Sunday Morning Coming Down&rdquo; and &ldquo;For The Good Times,&rdquo; as well as a slew of other empathetic, incisive gems. Kristofferson&mdash;along with contemporaries Tom T. Hall, Mickey Newbury, Willie Nelson and John Prine&mdash;enhanced the scope of country music songwriting, focusing on layering, nuance, empathy and emotional truth.<br />\r\n<br />\r\n&ldquo;A major reason for Kris&rsquo; enduring popularity is that he&rsquo;s always been very honest and open about revealing his inner life,&rdquo; says producer Don Was, who has worked with Kristofferson for the past 17 years. &ldquo;&lsquo;Sunday Morning Coming Down&rsquo; is a brutally frank, first-person narrative that just happens to hit a common nerve among millions of people, and that&rsquo;s why Kris is such a great artist. I suspect a whole lot of folks will be able to relate to Feeling Mortal, now and for years to come. It&rsquo;s totally in keeping with the body of Kris&rsquo; oeuvre.&rdquo;<br />\r\n<br />\r\nKristofferson and Was spent three days recording Feeling Mortal, cutting 20 songs and picking 10, then bolstering the basic tracks with stellar instrumental work from guitarist Mark Goldenberg, pedal steel master Greg Leisz, keyboardist Matt Rollins, violinist and vocalist Sara Watkins, bassist Sean Hurley and drummer Aaron Sterling.<br />\r\n<br />\r\nThey emerged with a piece of work that Was suggests is &ldquo;One of Kris&rsquo; finest albums.&rdquo;<br />\r\n<br />\r\nKristofferson isn&rsquo;t one to arm-wrestle with his own legacy, or to set his truths of today against the truths of his old-and-gone immortal self, but he&rsquo;s pleased that a life that has been sustained by the product of his own imagination remains fruitful.<br />\r\n<br />\r\nAbove all, Kristofferson is happy to be happy, grateful to be grateful, and wholly unwilling to take the credit for the wondrous way it&rsquo;s all worked out. In the end, Feeling Mortal is a melodic note of gratitude, from creator to Creator.<br />\r\n<br />\r\n&ldquo;God Almighty, here I am,&rdquo; he sings. &ldquo;Am I where I ought to be? I&rsquo;ve begun to soon descend, like the sun into the sea/ And I thank my lucky stars, from here to eternity/ For the artist that You are/ And the man you made of me.&rdquo;<br />\r\n<br />\r\n<br />\r\nFor more information: <a href="http://www.kriskristofferson.com">Kris Kristofferson Website</a></p>\r\n', 1, 0, 1, '2012-12-31 13:50:50', '2013-01-02 14:35:58'),
(4, 1, NULL, 2, 'Radio Submit TV Commercial Making Waves in the Music World', '<p>The new Radio Submit TV commercial has been added over the past couple of months and will continue in 2013 on the following TV programs. Plus our YouTube promo video now has 91,779 views. 2012 was an outstanding year for Roots Music Report and Radio Submit. 2013 is shaping up to be even better. Thanks to all the Artists, Labels, Radio Stations &amp; The Radio Submit staff in Florida,Tennessee, Texas and Utah.<br />\r\n<iframe align="middle" frameborder="0" height="315" name="Radio Submit" scrolling="no" src="http://www.youtube.com/embed/TloXxeYKc9s" width="560"></iframe><br />\r\nTV Program Name<br />\r\n<br />\r\nUltimate Answers<br />\r\nAustin Stevens Adventures<br />\r\nBondi Rescue<br />\r\nBaltic Coasts<br />\r\nX-Fighters 2011 Highlights<br />\r\nTorc Off Road Jam<br />\r\nBET Inspiration<br />\r\nTorc Off Road Jam<br />\r\nBoxing<br />\r\nHustle<br />\r\nAntiques Roadshow<br />\r\nStrangers in Danger<br />\r\nBeing: Liverpool<br />\r\nEnglish Premier League Soccer<br />\r\nCops<br />\r\nBoxing<br />\r\nUFC Reloaded<br />\r\nTorc Off Road Jam<br />\r\nAMTV2<br />\r\nJump Start<br />\r\nAMTV2<br />\r\nAMTV<br />\r\nChristina Aguilera<br />\r\nSucker Free Countdown<br />\r\nClean House<br />\r\nUFC Ultimate Insider<br />\r\nSaved by the Bell: The College Years<br />\r\nRob &amp; Big<br />\r\nCMT Music<br />\r\nUFC: Guillard vs. Miller Prelims<br />\r\nAMTV2<br />\r\nNumbnuts<br />\r\nRoom Raiders 2.0<br />\r\nTORC: The Off Road Championship<br />\r\nWorld&#39;s Strictest Parents<br />\r\nPranked<br />\r\nRob &amp; Big<br />\r\n120 Minutes With Matt Pinfield<br />\r\nBellator Fighting Championships<br />\r\nBully Beatdown<br />\r\nBellator Fighting Championships 78<br />\r\nWild &#39;n Out<br />\r\nWake Up Call<br />\r\nSaved by the Bell<br />\r\nBoy Meets World<br />\r\nTop 20 Country Countdown<br />\r\nRob Dyrdek&#39;s Fantasy Factory<br />\r\nThe Wayans Bros.<br />\r\nPositively