(5, 1, 13, 1, 'Alison Krauss Added to Charlie Louvin Benefit', '<p>BELL BUCKLE, TENN. -- Valerie Smith is proud to announce that Alison Krauss has joined the line-up for Country Music Hall of Fame and Grand Ole Opry member Charlie Louvin&#39;s Benefit on Saturday, October 30, 2010 at the Bell Buckle Banquet Hall in historic Bell Buckle, TN from noon to 9:00 pm. Krauss will take the stage around 7:00 pm performing five Louvin Brother songs.</p>\r\n\r\n<p>Tickets are $10 and good for the entire day. They can be purchased at the world-famous Bell Buckle Cafe in Bell Buckle, Tenn., or by calling (931) 389-9693.</p>\r\n\r\n<p>The benefit schedule has been announced as follows:</p>\r\n\r\n<p>12:00 pm - Charlie&#39;s Living Room (see below)<br />\r\n2:00 pm - Valerie Smith &amp; Becky Buller<br />\r\n3:00 pm - Ed Bruce<br />\r\n3:30 pm - Patsy &amp; Donna Stoneman<br />\r\n4:00 pm - Wildwood Valley Boys<br />\r\n4:45 pm - Charlie&#39;s Living Room<br />\r\n5:30 pm - Valerie Smith &amp; Becky Buller<br />\r\n6:30 pm - Charlie Louvin &amp; Friends<br />\r\n7:00 pm - Alison Krauss with Jerry Douglas, Ron Block, Victor Krauss &amp; Carmella Ramsey<br />\r\n7:45 pm - Live Auction<br />\r\n8:30 pm - Charlie&#39;s Living Room</p>\r\n\r\n<p>Charlie&#39;s Living Room artists include:<br />\r\nJeff Barry, Ed North, Wilford Ray, Jon Weisberger, Larry Felix, Billy Kitchen, Mike Allen, Mike Scott, Shane Blackwell, Kristy Morris Band, Bobby Powell, Kyle Kraft and many more!</p>\r\n\r\n<p>Donations can be mailed to: The Charlie Louvin Fund, PO Box 42, Wartrace, TN 37183</p>\r\n\r\n<p>The Silent Auction will take place during the day with the Live Auction at 7:45 pm. The Live Auction will be conducted by Jerry Shelton, Johnny Foster and Tom Waynick from Shelton Auction &amp; Realty of Shelbyville, Tenn. Louvin has donated a guitar and autographed posters to the auction. Thanks to the following businesses for donating items to the auction including but limited to: Grand Ole Opry; Country Music Hall of Fame; WSM Radio; ASCAP; Alan Messer Photography; Kincaid&#39;s; Celebration Travel; Christopher Equipment; Discount Arts and Frames; Shelbyville Record Shop; Barr&#39;s; Hoover Paint; Smith Country Ham; New Covenant Bookstore; Badcock&#39;s; Victory Nissan; Heritage Jewelers; J. Jordan Boutique; Haynes Lumber; and First Community Bank. From Wartrace, Tenn.: Gallagher Guitars. From Manchester, Tenn.: Hoover&#39;s Jewelers; Smoots Flowers &amp; Gifts; Home Depot; Russell Stover Candies and Foothills Crafts. From Bell Buckle, Tenn.: Vera&#39;s Pearls; The Cat&#39;s Meow; Phillips General Store, and so many more.</p>\r\n\r\n<p>MORE INFORMATION ON THE CHARLIE LOUVIN BENEFIT</p>\r\n\r\n<p>The event is an effort to help defray Louvin&#39;s astronomical medial costs as he fights pancreatic cancer. The benefit will be hosted by Louvin and Valerie Smith &amp; Liberty Pike.</p>\r\n\r\n<p>We would like to extend a special thanks to Dan Hays and the International Bluegrass Music Association (IBMA) of Nashville, Tenn., for donating two VIP packages to next year&#39;s IBMA awards show at the Ryman Auditorium and two VIP passes to the IBMA FanFest, which is held annually at the Nashville Convention Center.</p>\r\n\r\n<p>Food will be available for sale from the the world-famous Bell Buckle Cafe in downtown Bell Buckle, Tenn., with all proceeds going to the Louvin family.</p>\r\n\r\n<p>Seven-time IBMA &quot;Female Vocalist of the Year&quot; Rhonda Vincent is hosting a silent auction on her website, RhondaVincent.com, with all proceeds going to the Louvin family. Items include a Martin guitar signed by Vincent as well as autographed posters and Martha White memorabilia as well as an autographed copy of Vincent&#39;s brand new album Taken.</p>\r\n\r\n<p>The Louvin Brothers (Charlie and Ira) had a string of country hits throughout the 1950s and early &#39;60s including &quot;When I Stop Dreamin&#39;, &quot;I Don&#39;t Believe You Met My Baby,&quot; and &quot;My Baby&#39;s Gone.&quot; Their music heavily influenced such groups as the Everly Brothers, the Byrds and even the Beatles.</p>\r\n\r\n<p>After Ira&#39;s tragic death in an auto accident, Charlie Louvin continued on in his solo career until the present day, regularly hosting the Grand Ole Opry and the Ernest Tubb Midnight Jamboree on WSM 650 AM as well as touring throughout the country and around the world.</p>\r\n\r\n<p>The Louvin Brothers are members of the Country Music Hall of Fame as well as the Nashville Songwriters Hall of Fame and the Alabama Music Hall of Fame.</p>\r\n', 1, 1, 0, '2013-01-02 15:39:17', '2013-01-02 15:39:17'),
(11, 1, 16, 1, 'UNEARTHED RAY CHARLES RARITIES SET FOR RELEASE BY CONCORD RECORDS OCTOBER 26', '<p>Concord Records is proud to announce the release of Rare Genius: The Undiscovered Masters, an incredible collection of newly discovered Ray Charles recordings. The tracks embody the remarkable breadth of musical styles that were synonymous with this classic American artist.</p>\r\n\r\n<p>In 2009, after six months of sifting and sorting through four decades worth of demos and other previously unissued material at Charles&rsquo; R.P.M. International studios on Los Angeles&rsquo; Washington Boulevard, Concord Music Group&rsquo;s executive vice president of A&amp;R, John Burk, emerged with a handful of startling recordings from the &lsquo;70s, &lsquo;80s and &lsquo;90s that reaffirm the vast scope of Charles&rsquo; artistic vision and stylistic range. Burk, who first worked with Charles as producer of his final studio album, 2004&rsquo;s Grammy-winning Album of the Year, Genius Loves Company stated, &ldquo;We have so much respect for Ray, and now being the guardians of his legacy, we didn&rsquo;t want to release anything substandard. In the end, I think what we have here is on par with some of his greatest works.&rdquo;</p>\r\n\r\n<p>In addition to the tracks culled from R.P.M. International, the set also includes a surprise from the Sony vaults &ndash; a stirring rendition of Kris Kristofferson&rsquo;s &ldquo;Why Me, Lord?&rdquo; a gospel flavored duet with Johnny Cash produced by Billy Sherrill in Nashville, recorded in 1981. This one-of-a-kind pearl has gone unheard by the public until now. Contrary to correspondence between Charles and Cash anticipating the release of the song on CBS, the track never saw the light of day for three decades for reasons that remain unknown. Cash takes the lead vocal, while Charles hangs back slightly and delivers hefty backup vocals and equally compelling piano lines. &ldquo;Ray&rsquo;s presence in the song helps to establish a sort of marriage between gospel, Christian and country music &ndash; the kind of thing Ray was so uniquely good at,&rdquo; says Burk.</p>\r\n\r\n<p>Some of the tracks which emerged from the R.P.M. vault in sparse, stripped-down form &ndash; have been sonically enhanced ever-so-slightly by a crew of top-notch artists: guitarists Keb&rsquo; Mo&rsquo; and George Doering, organist Bobby Sparks, trumpeter Gray Grant, trombonist Alan Kaplan, bassists Trey Henry and Chuck Berghofer, drummers Gregg Field and Ray Brinker, and background vocalist Eric Ben&eacute;t.</p>\r\n\r\n<p>The dark side of &lsquo;love&rsquo; is a running theme throughout Rare Genius. The highlights include the set opener &ldquo;Love&rsquo;s Gonna Bite You Back,&rdquo; a track from a March 1980 session that features an upbeat horn arrangement behind what liner notes author Bill Dahl calls &ldquo;a Charles vocal that&rsquo;s a signature mixture of sandpaper grit and heavenly goodness.&rdquo; Burk adds: &ldquo;I don&rsquo;t know how many other singers could really pull that off, and make it seem so effortless. What he does rhythmically is just incredible.&rdquo;</p>\r\n\r\n<p>&ldquo;It Hurts To Be In Love&rdquo; was one of the first unreleased tracks we heard,&rdquo; Burk recalls. &ldquo;Valerie Ervin, president of the Ray Charles Foundation, discovered it and played it for me. We were both stunned and excited by how good it was. This song quickly became the centerpiece of the album. The other songs were chosen, first and foremost because they were great Ray Charles performances, but also because they felt connected to this song, often thematically. Later, in doing research on our choices, we discovered Ray had begun compiling some of the same material and had put four of these songs on one reel, including &ldquo;It Hurts To Be In Love.&rdquo;</p>\r\n\r\n<p>The soul-drenched &ldquo;I Don&rsquo;t Want No One But You,&rdquo; is fueled by Charles&rsquo; emotionally powerful vocals and a gospel-charged backing chorus. &ldquo;Something I learned about Ray in this process,&rdquo; said Burk &ldquo;was that he kept up with new recording technology as a tool for making music. He had developed the arrangement for this song by creating a demo with samplers and synthesizers, giving this song a bit more contemporary feel.&rdquo;</p>\r\n\r\n<p>Rare Genius contains examples of Ray&rsquo;s love and mastery of country music including an imaginative arrangement of recently departed songsmith Hank Cochran&rsquo;s &ldquo;A Little Bitty Tear,&rdquo; recorded in 1983. Ray pours a dose of the blues over Cochran&rsquo;s gem that&rsquo;s a long way from Burl Ives&rsquo; lilting 1961 hit reading. Ray&rsquo;s version was nearly complete but had been recorded in an unconventional way. &ldquo;Ray had recorded the piano, strings, lead and background vocals,&rdquo; says Burk, &ldquo;and he had just started to work on programming some drum ideas but hadn&rsquo;t finished. We simply added a little bass and drums to finish it off.&rdquo;</p>\r\n\r\n<p>&ldquo;She&rsquo;s Gone&rdquo; is a bit of sleight-of-hand as only Charles can do it. &ldquo;It&rsquo;s a sad song,&rdquo; says Burk. &ldquo;He&rsquo;s losing the girl, but at the same time, it&rsquo;s fun and playful. It&rsquo;s really interesting how Ray delivers the message of pain, but he&rsquo;s upbeat about it at the same time.&rdquo;</p>\r\n\r\n<p>&ldquo;Wheel of Fortune&rdquo; was a pop smash for Kay Starr in 1952, its intro the sound of a spinning roulette wheel. Charles gave the Bennie Benjamin/George David Weiss ballad a sultry spin in 1972 &ndash; his brilliant keyboard work and imaginative vocal leaving such gimmicky sound effects altogether unnecessary.</p>\r\n\r\n<p>Regarded as &ldquo;the Genius&rdquo; by virtually everyone within the sound of his mesmerizing voice and powerful keyboard work, Charles was &ndash; and continues to be &ndash; a towering figure in the annals of American popular music whose influence on subsequent generations is incalculable. &ldquo;The rhythmic and improvisational things Ray did with his vocals were incredibly influential to generations of singers in all genres of music,&rdquo; says Burk. &ldquo;And he would always get inside the meaning of a lyric and make the listener believe every word, as if he were describing his own experiences. His vocals carried incredible emotion and intensity, even on demo tapes. That&rsquo;s how Ray approached his music; I don&rsquo;t think he knew any other way to do it.&rdquo;</p>\r\n\r\n<p><br />\r\nGood things do indeed come to those who wait. Six years after Ray Charles&rsquo; passing and just in time for Ray&rsquo;s 80th birthday celebration on September 23rd, Rare Genius: The Undiscovered Masters provides the world with a fresh look at what made him such a pivotal and enduring figure on the landscape of 20th century American music.</p>\r\n', 1, 1, 0, '2013-01-02 15:46:45', '2013-01-02 15:46:45');
