INSERT INTO `reviews` (`id`, `user_id`, `band_id`, `album_id`, `sub_genre_id`, `review`, `rating`, `featured`, `approved`, `approved_by`, `edited_by`, `created`, `modified`) VALUES
(1, 1, 1065, 1134, 28, '<p>Playing Time - 40:58 -- George Clark wrote or co-wrote five of the songs on &quot;Back Home,&quot; the first release on CGS Records label in Portland, Tn. &quot;Going Home&quot; tells a lively story of a prisoner being released and looking forward to his trip back to Virginia. &quot;Going Home&quot; was aired as a featured track on Volume 74 of &quot;Prime Cuts of Bluegrass.&quot; The original songs &quot;All That She Said&quot; and &quot;Burnin&#39;&quot; are both well-written additions to the bluegrass canon that have traditional-sounding cornerstones. &quot;Bacon Holler Breakdown&quot; is a snappy instrumental dedicated to Clark&#39;s family, the Shiffletts. Clark also covers some traditional gospel, as well as songs previously recorded by Larry Sparks, The Louvin Brothers, Vern Gosdin and Jimmy Martin. Clark&#39;s vocals resonate with conviction, and he has assembled a host of first class musicians.</p>\r\n\r\n<p>In 2001, George and his family moved to Nashville, Tn. to pursue his singing and songwriting career. According to Clark&#39;s website, Dixie Flyer&#39;s current members include Ferrell Stowe (Dobro), Mitchell Drew (mandolin), Rick Otts (banjo), Alan Sparkman (bass), and Charles Duffey (fiddle, mandolin). Dobro-player Stowe appears on all tracks on &quot;Back Home,&quot; and he is no newcomer to the bluegrass scene with over 30 years of experience. I particularly like the sound of Dobro in the bluegrass context and wish that more releases incorporated that instrument as tastefully played as Stowe does.</p>\r\n\r\n<p>Drew appears as a vocalist on &quot;A Face in the Crowd&quot; and &quot;Are You Washed in the Blood,&quot; and Otts only appears as a vocalist on the opening song, &quot;A Face in the Crowd.&quot; Sparkman and Duffey don&#39;t sing. Rather, the CD includes Stephen Mougin (mandolin), Shadd Cobb (fiddle), Beth Lawrence (bass), Patton Wages (banjo), Jesse Cobb (mandolin), and Carl Franklin (fiddle). So it&#39;s a little confusing as to who exactly Clark&#39;s band &quot;Dixie Flyer&quot; currently consists of, or whether this album was primarily meant as a solo project to showcase Clark&#39;s singing and songwriting. In the former category, it&#39;s quite impressive that many of the vocal harmonies are ably handled by Clark.</p>\r\n\r\n<p>George Clark has a very engaging voice that is well suited to bluegrass music. It&#39;s immediately appealing, and his songs are arranged in satisfying form. I expect to be hearing much more from George Clark and Dixie Flyer as they get more established and get their name out there. This successful project should land them a number of festival and club gigs.</p>\r\n', 4, 0, 1, 1, 1, '1969-12-31 00:00:00', '2012-12-28 13:17:48'),
(21, 1, 1066, 1135, 7, 'The Cowbopsters are back with their fourth album called ''Cowlifornia Swing,'' and there are plenty of both western and jazz influences apparent. Much like their last album (''Too Hick for the Room'') we hear guitarist Bruce Forman, vocalist Pinto Pammy (Formans wife), bassist Alex King and drummer Jake Reed. The quintet has also added David Wise on saxophone and cornet. On several cuts, guests fill out the new album with tints of piano, fiddle, trombone, cello, mandolin and accordion. All are hot tunesters with solid credentials. Bruce Forman teaches jazz guitar at USCs Thornton School of Music, and others in the band are (or were) students there. Like their last successful album, Thornton alumnus Doug Gerry produced, and faculty member Andrew Garver mastered.\r\n\r\nSpade Cooley coined the term Western Swing in the early 1940s, and its interesting that Spade was a Los Angeles resident like the members of Cow Bop. He had fortune and fame, but was imprisoned in 1961 for murder. Despite the thousands of bands playing all over the West during the heyday of Western Swing, the genre is most closely associated with Bob Wills and his Texas Playboys. Cow Bop pays tribute to them with a boss arrangement of Roly Poly that wisely includes Phil Salazars fiddle, the only cut with that classic western swing instrument, albeit played electric on this song.\r\n\r\nCow Bops approach to bovine boogie also taps jazz standards (Ive Found a New Baby), pop fare (These Boots are Made for Walking, Mambo Italiano), country (Cattle Call), western (Wahoo), and some less oft-heard big band tunes (A Gal in Calico). The jazz chops predominate in these uplifting tunes and make for an enjoyable listen. We also hear Pinto Pammys countrified sounds, like yodeling in Cattle Call and call-and-response (with David Jackson) in the novelty number Wahoo. Shes also comfortably smooth with a swinging version of Indian Love Call, quite unlike the rendition done by Nelson Eddy and Jeanette MacDonald. Six-minute offerings like What is this Thing called Love? and These Boots are Made for Walking allow multiple instrumentalists to showcase with improvisation between verses. The arrangements are solid, but I wonder if they write any originals.\r\n\r\nWhile some of Cow Bops influences are clearly organic and corn-fed, Cow Bops jazzy twang also provides a copious amount of toe-tapping fun. There may not be many big roadhouses and dancehalls left today, but you can catch this band at fairs, festivals, cafes, rodeos, burger joints and places like the Viva Cantina in Burbank. I havent ever been there, but I imagine it as a place where young folks, old-timers, friends and neighbors all know each other and gather for listening or dancing the night away. Hailing from busy and heavily populated Southern California, Cow Bops music conveys a rural ethos, but also demonstrates an urban, contemporary understanding. ''Cowlifornia Swing'' is music for dancing so roll up the rug, throw some cornmeal on the floor, invite the neighbors over and throw a party to their music. ', 4, 0, 1, 1, 1, '2012-12-24 00:00:00', '2012-12-27 12:03:55'),
(22, 1, 1067, 1136, 28, 'James King''s robust vocals are known for being raw, pure and full of emotion. King also has a clear affinity for sad songs. He plays no guitar on this project, and instead just concentrates on telling his stories. And a sad song like "Echo Mountain" (written by Billy Smith and Mac Elliott) might bring tears to your eyes. There are no rollicking and smoldering extremes on "The Bluegrass Storyteller," but rather messages and musicianship that hold your attention in a different sort of way emphasizing a more subtle bluegrass framework. King renders a ballad, "Jerusalem Tomorrow," with only his vocals, some mournful fiddle and rhythm accompaniment. Two other numbers ("Second Handed Flowers" and "Carroll County Accident") are sung solo; five songs are arranged for duets. This leaner approach to the vocals allows us to stay focused on James King''s emotive messages and personal intensity. James delivers each lyric with very convincing emotion.\r\n\r\nKing''s consummate bandmates add a lot to this project. Guitarist/mandolinist Kevin Prater''s high baritone on "Echo Mountain" is spine-tingling. Ben Greene''s banjo drives "Flowers in the Dell" and "Carroll County Accident." Adam Haynes is blessed with a silky touch on his fiddle bow that allows him to move effortlessly from note to note. Jerry McNeely''s bass provides a rock solid foundation, especially on more up-tempo selections like "Saginaw, Michigan." That piece builds to a soaring 3-part chorus with Prater and Greene assisting.\r\n\r\nJames King has won great acclaim from the bluegrass community for his heartfelt and soulful singing. A vocalist also knows that he must interpret songs with poignancy and character. He draws material from Tom T. Hall, Lefty Frizzell, David Olney, Bob Ferguson, Fred Eaglesmith, Buddy Miller, Carl Jackson and others. Track listing on this 46-minute album: 1 Coldest Day of Winter 2 Echo Mountain 3 She Took His Breath Away 4 Stumbling in My Father''s Footsteps 5 Jerusalem Tomorrow 6 Flowers in the 7 Second Handed Flowers 8 Saginaw, Michigan 9 The Garage Sale 10 Carroll County Accident 11 Cold Hard Facts of Lies 12 Whatever Happened to Julie? 13 Just as the Sun Went Down\r\n\r\nWith a distinctive country feeling, James Kings'' "The Bluegrass Storyteller" tells a baker''s dozen of beautiful, life-affirming tales. Lilting melodies and tender sentiments characterize this album which closes with a stirring gospel quartet on "Just as the Sun Went Down."\r\n\r\nSpade Cooley coined the term Western Swing in the early 1940s, and its interesting that Spade was a Los Angeles resident like the members of Cow Bop. He had fortune and fame, but was imprisoned in 1961 for murder. Despite the thousands of bands playing all over the West during the heyday of Western Swing, the genre is most closely associated with Bob Wills and his Texas Playboys. Cow Bop pays tribute to them with a boss arrangement of Roly Poly that wisely includes Phil Salazars fiddle, the only cut with that classic western swing instrument, albeit played electric on this song.\r\n\r\nCow Bops approach to bovine boogie also taps jazz standards (Ive Found a New Baby), pop fare (These Boots are Made for Walking, Mambo Italiano), country (Cattle Call), western (Wahoo), and some less oft-heard big band tunes (A Gal in Calico). The jazz chops predominate in these uplifting tunes and make for an enjoyable listen. We also hear Pinto Pammys countrified sounds, like yodeling in Cattle Call and call-and-response (with David Jackson) in the novelty number Wahoo. Shes also comfortably smooth with a swinging version of Indian Love Call, quite unlike the rendition done by Nelson Eddy and Jeanette MacDonald. Six-minute offerings like What is this Thing called Love? and These Boots are Made for Walking allow multiple instrumentalists to showcase with improvisation between verses. The arrangements are solid, but I wonder if they write any originals.\r\n\r\nWhile some of Cow Bops influences are clearly organic and corn-fed, Cow Bops jazzy twang also provides a copious amount of toe-tapping fun. There may not be many big roadhouses and dancehalls left today, but you can catch this band at fairs, festivals, cafes, rodeos, burger joints and places like the Viva Cantina in Burbank. I havent ever been there, but I imagine it as a place where young folks, old-timers, friends and neighbors all know each other and gather for listening or dancing the night away. Hailing from busy and heavily populated Southern California, Cow Bops music conveys a rural ethos, but also demonstrates an urban, contemporary understanding. ''Cowlifornia Swing'' is music for dancing so roll up the rug, throw some cornmeal on the floor, invite the neighbors over and throw a party to their music. ', 4, 0, 1, 1, 1, '2012-12-20 00:00:00', '2013-01-02 11:37:46'),
