(24, 1, 1068, 1137, 10, 'This 19-minute EP of six songs from singer Bryan White is a very pleasant little gift. Opening with White Christmas, Bryan croons his wish for the season along with some sweet harmony from Lisa Conner. The First Noel features his brother, Daniel, along with an acoustic guitar solo by Steve Wariner. The instrumental God Rest Ye Merry Gentlemen has Bryan playing both sitar and drums in the mix with a raucous expression to a piece we more often hear done with more subtlety. Besides being a supple vocalist, White also plays acoustic and electric guitars on this short set of his holiday tunes.\r\n\r\nA live take of Santa Claus Is Coming To Town is a splendid demo of the bands live upbeat sound with Brinson Stricklands electric guitar, Tom Bentleys keyboards, Randle Curries steel, and others. Bryan Whites own The Heart of Christmas features a child scripture reading by Allie McCraw. The 3-minute bonus track has a recording of Santa visiting the White family from one of his favorite childhood Christmas memories. A video of the event is on Whites website. We thank White for his musical and other sentiments at this special time of the year. ', 3, 0, 0, 0, 1, '2012-12-02 00:00:00', '2012-12-02 00:00:00');
